// LINK: https://leetcode.com/problems/find-smallest-letter-greater-than-target/
/**
 * @param {character[]} letters
 * @param {character} target
 * @return {character}
 */

/*
This is a binary search that is a little more complex than it needs to be. 
*/
 var nextGreatestLetter = function(letters, target) {
    let start = 0
    let end = letters.length -1

    let targetNum = target.charCodeAt(0) + 1

    while(start <= end){

        if(start === end){
            if(start === letters.length -1)
                return letters[0]
            
            let lastLetterNum = letters[start].charCodeAt(0)
            if(targetNum > lastLetterNum)
                return letters[start+1]
            else 
                return letters[start]
            
        }
            

        let middle = Math.ceil((start+end) /2)
        let middleNum = letters[middle].charCodeAt(0)

        // if the middleNum is equal to the target then return the character there
        if(middleNum === targetNum)
            return letters[middle]
        
        // if the middle num is > than target num look to the left side of the partition
        if(middleNum > targetNum)
            end = middle - 1
        // else look to the right side of the partition
        else 
            start = middle
    }

};


// A better solution
var nextGreatestLetter = function(letters, target) {
    let low = 0;
    let high = letters.length;
    
    while(low<high){
        let mid = Math.floor(low+(high-low)/2);
        
        if(letters[mid]<=target) low = mid+1;
        
        else high = mid;
    }
    
    return letters[low%letters.length];
};

